import Vue from 'vue';
import Vuex from 'vuex';
import VuexPersistence from 'vuex-persist';

Vue.use(Vuex);

const vuexLocal = new VuexPersistence({
  storage: window.localStorage
});

export default new Vuex.Store({
  state: {
    env: 'dev',
    /*baseUrl: "http://localhost:8082/nexus/deploy/backend-sf4-api/public/api/",
    eaUrl: 'http://localhost:8082/nexus/deploy/ea/index.php/',*/
	  baseUrl: "http://nexus.enaebl.com/api/",
    eaUrl: "http://nexusea.enaebl.com/",
    authRouteRequested: null,
    debug: true,
    homeUrl: null,
    dsaFormsUrl: null,
    registrations: [],
    authType: null,
    beepFile: 'data:audio/mp3;base64,',
    payload: {
      is_guest: true,
      jwt: null,
      roles: []
    }
  },
  mutations: {
    updatePayload(state, payload) {
      state.payload = payload;
    },
    logout(state) {
      state.registrations = [];
      state.authRouteRequested = null;
      //state.homeUrl = null;
      state.dsaFormsUrl = null;
      state.authType = null;
      state.payload = {
        is_guest: true,
        jwt: null,
        roles: []
      };
    }
  },
  plugins: [vuexLocal.plugin]
});
